import React from 'react';
import { Dropdown } from 'react-native-material-dropdown';
import { Text, View } from 'react-native';

export function LeftComponent(props) {

    const options = [
        {
          label: 'News'
        },
        {
          label: 'Design'
        },
        {
          label: 'Sales'
        },
        {
          label: 'Marketing'
        },
        {
          label: 'Customer Success'
        }
      ];

    return (
        <View style={ styles.container }>
        <Select
          options={options}
          defaultOption={4}
          onSelect={(index) => { console.log(index, 'is selected.'); }}/>
      </View>
    );
}
export function CenterComponent(props) {



    return (
        <Text>Woke-Muz</Text>
    );
}
